import React from 'react';
import { Flex, Button, Heading } from "@chakra-ui/core";
import { styled } from "../theme";

const Wrapper = styled(Flex)({
    width: "100vw",
    height: "100vh"
})
export const Homepage = () => {
    return (
        <Box>
            <Wrapper direction="column" justify="space-around" align="center">
                <Heading as="h1" size="2xl">FYSP</Heading>
                <Button>Start</Button>
            </Wrapper>
        </Box>
    )
}
